import React, { useEffect } from "react";
// import { useDispatch } from "react-redux";
import { get } from "lodash";

const PageComponent = props =>{
  // const dispatch = useDispatch();
  // useEffect(() => {
  //     requestApiData();
  // }, [dispatch])
  const { requestApiData, routerDetails, homeDetails, isFetching } = props;
  const avatar = get(homeDetails, "UserInfo.avatar") || "";
  const email = get(homeDetails, "UserInfo.email") || "";
  const firstName = get(homeDetails, "UserInfo.first_name") || "";
  const lastName = get(homeDetails, "UserInfo.last_name") || "";
  const userId = get(homeDetails, "UserInfo.id") || "";
  console.log("homeDetails2222", avatar)
  useEffect(() => {
    let orderId = 4;
    requestApiData(orderId);
  }, []);

  console.log("homeDetails", isFetching);
  return (
    <div>
      This is home!!
      {!isFetching && console.log("homeDetails2222", homeDetails.home.avatar)}
      {!isFetching && (
        <>
          <img src={avatar} alt="" />
          <h2>First Name: {firstName}</h2>
          <h2>Last Name: {lastName}</h2>
          <h2>User ID: {userId}</h2>
          <h2>Email: {email}</h2>
          <h2>Order Status!!</h2>
          <h2>Order Id: </h2>
          <h2>Order Quantity</h2>
          <h2>Shipped date</h2>
          <h2>Order Status</h2>
        </>
      )}
    </div>
  );
}

export default PageComponent;
